// AdminContent.js
import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import ViewerManagement from './ViewerManagement';
import EditorsList from './EditorsList';
import RegisterPage from './RegisterPage'; // Import RegisterPage if you want to allow registration from admin

const AdminContent = () => {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <nav>
        <Link to="/admin/viewers">Manage Viewers</Link>
        <Link to="/admin/editors">View Editors</Link>
        <Link to="/admin/register">Register New Admin</Link>
      </nav>
      <Routes>
        <Route path="/viewers" element={<ViewerManagement />} />
        <Route path="/editors" element={<EditorsList />} />
        <Route path="/register" element={<RegisterPage />} />
        {/* Add more admin routes here */}
      </Routes>
    </div>
  );
};

export default AdminContent;
